from django.contrib.auth.models import AbstractUser, Group, Permission
from django.db import models
from django.utils.translation import gettext_lazy as _

class CustomUser(AbstractUser):
    credit = models.IntegerField(default=200)
    is_subscribed = models.BooleanField(default=True)
    is_supporter = models.BooleanField(default=False)
    t1 = models.TextField(null=True)
    c1 = models.JSONField(null=True)
    ci1 = models.TextField(null=True, default="data:image/png;base64,")
    t2 = models.TextField(null=True)
    c2 = models.JSONField(null=True)
    ci2 = models.TextField(null=True, default="data:image/png;base64,")
    t3 = models.TextField(null=True)
    c3 = models.JSONField(null=True)
    ci3 = models.TextField(null=True, default="data:image/png;base64,")
    t4 = models.TextField(null=True)
    c4 = models.JSONField(null=True)
    ci4 = models.TextField(null=True, default="data:image/png;base64,")
    t5 = models.TextField(null=True)
    c5 = models.JSONField(null=True)
    ci5 = models.TextField(null=True, default="data:image/png;base64,")
    t6 = models.TextField(null=True)
    c6 = models.JSONField(null=True)
    ci6 = models.TextField(null=True, default="data:image/png;base64,")
    t7 = models.TextField(null=True)
    c7 = models.JSONField(null=True)
    ci7 = models.TextField(null=True, default="data:image/png;base64,")
    t8 = models.TextField(null=True)
    c8 = models.JSONField(null=True)
    ci8 = models.TextField(null=True, default="data:image/png;base64,")
    t9 = models.TextField(null=True)
    c9 = models.JSONField(null=True)
    ci9 = models.TextField(null=True, default="data:image/png;base64,")
    t10 = models.TextField(null=True)
    c10 = models.JSONField(null=True)
    ci10 = models.TextField(null=True, default="data:image/png;base64,")
    
    
    
    
    
    
    
    groups = models.ManyToManyField(
        Group,
        verbose_name=_('groups'),
        blank=True,
        related_name='custom_user_groups'
    )
    user_permissions = models.ManyToManyField(
        Permission,
        verbose_name=_('user permissions'),
        blank=True,
        related_name='custom_user_permissions'
    )